The problem can be solved programmatically using GNU Octave. We can use the geometric series formula to calculate the sum of the series. The formula for the sum of a geometric series is:

$$S = \frac{a(1 - r^n)}{1 - r}$$

where $a$ is the first term, $r$ is the common ratio, and $n$ is the number of terms. In this case, $a = \frac{1}{2}$, $r = \frac{1}{2}$, and $n = 10$.

```octave
function sum_of_series
  a = 1/2;
  r = 1/2;
  n = 10;

  S = a * (1 - r^n) / (1 - r);
  return S;
end

result = sum_of_series();
disp(result);
```
