function solve_age_problem
  % Define the variables
  j = symbols('j'); % John's age
  d = symbols('d'); % Dad's age

  % Define the equations
  eq1 = Eq(j, d - 31);
  eq2 = Eq(j + d, 53);

  % Solve the system of equations
  solution = solve((eq1,eq2), (j, d));

  % Print the result
  disp(solution(d));
end

solve_age_problem()

