Rationale: The midpoints of the diagonals of a square coincide, so the midpoint of the line segment joining (7,9) and (10,2) is the same as the midpoint of the line segment joining the other two vertices of the square.  The average of the $y$-coordinates of (7,9) and (10,2) is the $y$-coordinate of their midpoint, which in turn is also equal to the average of the $y$-coordinates of the missing vertices.  Therefore, the average of the $y$-coordinates of (7,9) and (10,2) is equal to the average of the $y$-coordinates of the two missing vertices.  Since the sum is twice the average, the sum of the $y$-coordinates of the missing vertices is the same as that of the given vertices: $9+2=$.

