1. The ratio of blue marbles to yellow marbles is 4:3, which gives us the equation $\frac{b}{y} = \frac{4}{3}$.
2. After adding 5 blue marbles and removing 3 yellow marbles, the ratio becomes 7:3, which gives us the equation $\frac{b+5}{y-3} = \frac{7}{3}$.

We can solve this system of equations using GNU Octave:

```octave
function solve_marble_problem()
    % Define the equations
    eq1 = @(b, y) b/y - 4/3;
    eq2 = @(b, y) (b+5)/(y-3) - 7/3;

    % Set up the system of equations
    system = {eq1, eq2};

    % Solve the system of equations
    solution = fsolve(system, [1, 1]);

    % Get the number of blue marbles
    b = solution(1);

    % Print the result
    disp(b);
end

result = solve_marble_problem();
```
