Here's a sample Octave code to solve the problem:

```octave
function solve_parabola
    % Given vertex of the parabola (-3, 1)
    h = -3;
    k = 1;

    % Given point on the parabola (-2, 2)
    x1 = -2;
    y1 = 2;

    % Equation of the parabola in vertex form
    equation = @(y) (y - h)^2 + k;

    % Solve for 'a' using the given point
    a = (x1 - equation(y1)) / (y1 - 1)^2;

    % Find 'b' and 'c' by comparing coefficients
    b = -2 * a * h;
    c = a * h^2 + k - a;

    return a + b + c;
end

